import React, { Component } from 'react';

class AdminUser extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userList: this.props.userList
        }
        this.showUserList = this.showUserList.bind(this);
    }

    manageUser() {
        let { userList } = this.state;
        let showUserList = userList.map((item, index) => {
            return (
                <tbody key={item.id}>
                        <tr key={item.id + index}>
                            <td key={item.name + index}>
                                {item.name} {item.surname}
                            </td>
                            <td key={item.Email + index}>
                                {item.description}
                            </td>
                            <td key={item.userGroup + index}>
                                {item.start}
                            </td>
                            <td key={item.subscribeTo + index}>
                                {item.end}
                            </td>
                            <td key={item.password + index}>
                                {item.location}
                            </td>
                        </tr>
                    </tbody>
            );
        })
    }

    render() {

        return (
            <div>
                <table className="table table-bordered eventtable">
                    <thead>
                        <tr>
                            <th><label>Event Type </label> </th>
                            <th><label>Event Description </label> </th>
                            <th><label>Event Start </label> </th>
                            <th><label>Event End </label> </th>
                            <th><label>Event Location</label> </th>
                        </tr>
                    </thead>
                    {this.showUserList}
                </table>
            </div>
        );
    }
}

export default AdminUser;
